import React from 'react';
import { Switch, Route } from 'react-router-dom';
import styled from 'styled-components';

import Home from './components/Home';

const AppWrapper = styled.div`
  margin: 0 auto;
  max-width: 800px;
  padding: 20px;
`;

function App() {
  return (
      <AppWrapper>
        <Switch>
          <Route exact path="/" component={Home} />
        </Switch>
      </AppWrapper>
  );
}

export default App;
